import React, { Component } from 'react';
import Card from 'react-animated-3d-card';

class Social extends Component {
    render() {
        return (

            <div class="col-social">

                <a href="https://github.com/zm00622" target="_blank" rel="noopener noreferrer"><i class="fab fa-github"></i></a>
                <a href="https://www.linkedin.com/in/zary-manning-4b8953198/" target="_blank" rel="noopener noreferrer"><i class="fab fa-linkedin-in"></i></a>
                <a href="https://www.zarymanning.com" target="_blank" rel="noopener noreferrer"><i class="fas fa-user-tie"></i></a>

            </div>

            )
        }
    }

export default Social

